import './NavBarStyle.css';

function NavBar(){

    let items = [{id:1,value:'Home'},{id:2,value:'About'},{id:3,value:'Timeline'},{id:4,value:'Contact'}];


    let handleChange = (e) => {
        e.preventDefault();
        
    }

    return(
        <nav>
            <div className="logo">
                Portfolio
            </div>
            <input type="checkbox" id="click"/>
            <label for="click" className="menu-button">
                <i className="fas fa-bars"></i>
            </label>
            <ul>
                {items.map(item => <li id={item.id}>{item.value}</li>)}
                
            </ul>
        </nav>
    );
}

export default NavBar;
